import React from "react";

function Option(props) {
  return (
    <div className="Option">
      <input type="checkbox" id={props.label} />
      {props.label}
      <div>
        {props.duration === 1 ? (
          <p>Day 1</p>
        ) : props.value === 2 ? (
          <>
            <p>Day 1</p>
            <p>Day 2</p>
          </>
        ) : (
          <>
            <p>Day 1</p>
            <p>Day 2</p>
            <p>Day 3</p>
          </>
        )}
      </div>
    </div>
  );
}

export default Option;
